import './App.css';
import logo from './logo.png';
import ceo from './CEO.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


export function About() {



const Image = () => {
    return (
        <div className="team-section">
          <h2>Our Team</h2>
          <div className="team-member">
            <img src={ceo} alt="Roy Nickolai" />
            <div>
              <h3>Rae Ann</h3>
              <p>CEO/Founder</p>
              <p>Roy founded All About Parking in 2005 and is an entrepreneur with over 30 years in the service industry. He is well-known throughout his native Bay Area for delivering extraordinary customer service. He has been a coach and leader for a variety of charitable organizations in the Bay Area.</p>
            </div>
          </div>
          <div className="team-member">
            <img src={ceo} alt="Tim Costello" />
            <div>
              <h3>Tim Costello</h3>
              <p>VP of Compliance</p>
              <p>Tim joined All About Parking in 2012 after 20 years running sales and operations at both Certichron and Graniterock. He keeps our business running smoothly, from overseeing HR and training, to accounting and payroll. Tim holds a BA from UCLA and an MBA from Santa Clara University.</p>
            </div>
          </div>
        </div>
      );
    }



return (

    <div>

     <nav className="navbar">
       <div className="logo">
         <img className="h-10 mr-3" style={{ width: '150px', height: '150px', padding: '5px' }} src={logo} alt="Logo" />
       </div>
       <ul className="nav-links">
         <li><a href="#valet-parking">Valet Parking</a></li>
         <li><a href="#commercial-services">Commercial Services</a></li>
         <li><a href="#locations">Locations</a></li>
         <li><a href="#careers">Careers</a></li>
         <li><a href="#about">About</a></li>
         <li><a href="ContactPage">Contact</a></li>
       </ul>
       <button className="quote-btn" style={{ padding:'20px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black' }}>Request a Quote</a> </button>

     </nav>
     <div style={{padding:'200px'}}>
       {Image()}
         </div>
       </div> 


   );





}
export default About;
